⠀⠀⠀⠀⠀⠀⠀⠀⠀
@tubbytodd Art Director @beckymsimps is welcoming her first baby in August! 🕊 In celebration of babysimps, Tubby Todd Bath Co. and @mother.ly are hosting Becky's BIG Baby Shower Giveaway! We've teamed up with some of her fave brands to gift over $4 500 in prizes to one lucky mama! Follow the steps below to enter to win all of the goodies:
⠀⠀⠀⠀⠀⠀⠀⠀⠀
Step 1: Like this post!
⠀⠀⠀⠀⠀⠀⠀⠀⠀
Step 2: Make sure you're following all brands here on IG:
⠀⠀⠀⠀⠀⠀⠀⠀⠀
@tubbytodd
@mother.ly
@shantripp
@sollybaby
@happiest_baby
@uppababy
@mushie
@snuggle_me_organic
@oeufnyc
⠀⠀⠀⠀⠀⠀⠀⠀⠀
Step 3: Tag (real!) friends below and give them a chance to win! Friends don’t let friends miss out on giveaways this good.
⠀⠀⠀⠀⠀⠀⠀⠀⠀
Step 4: Head to the link in @tubbytodd's bio to complete your entry.
⠀⠀⠀⠀⠀⠀⠀⠀⠀
*Giveaway ends at 11:59 p.m. PDT on 7/21. Winner will be announced by 7/26 on @tubbytodd's original giveaway post. Open to U.S. residents only. Void where prohibited by law, must be 18 years or older to enter. (Please note: winners will only be notified by the Tubby Todd Bath Co. account. If you receive messages from an account claiming to be a "giveaway winner selection" account please disregard and report as spam!) Good luck!
